function normalizeForModel(s, alphabetSet) {
  let t = s.toLowerCase().replace(REGEX_PUNCTUATION, " ").replace(REGEX_WHITESPACE, " ");
  // Replace all digits with 'zqx' - a very rare letter combination that will give high perplexity
  t = t.replace(REGEX_DIGITS, "zqx");
  if (!alphabetSet) return t;
  let out = "";
  for (const ch of t) if (alphabetSet.has(ch)) out += ch;
  return out;
}

function perplexityFromAvgNLL(avgNLL) {
  return Math.exp(avgNLL);
}

function trigramFilter(text, opts = {}) {
  const model = TRIGRAM_MODEL;
  const alpha = opts.alpha ?? model.alpha ?? 0.5; // Smoothing factor for probabilities
  const threshold = opts.threshold ?? 34; // Perplexity threshold to flag as nonsense
  const minLen = opts.minLen ?? 22; // Minimum length to apply main threshold filter
  const shortTextThreshold = opts.shortTextThreshold ?? 15; // Stricter threshold for short texts

  // Remove excessive character repetitions (3 or more identical characters in a row)
  const cleanedText = text.replace(REGEX_CHAR_REPETITION, '$1');

  const alphabetSet = new Set(model.alphabet.split(""));
  const V = model.V || alphabetSet.size || 1;

  const s = normalizeForModel(cleanedText, alphabetSet);
  if (s.length < 3) {
    return false; // Return false (don't filter) if too short to judge
  }

  let ll = 0;
  let T = 0;

  for (let i = 2; i < s.length; i++) {
    const ctx = s[i - 2] + s[i - 1];
    const nx = s[i];

    const nextList = model.table[ctx];
    if (nextList) {
      // binary search or map? nextList is small; linear scan is fine.
      let p = 0;
      for (let j = 0; j < nextList.length; j++) {
        if (nextList[j][0] === nx) { p = nextList[j][1]; break; }
      }
      if (p > 0) {
        ll += Math.log(p);
      } else {
        const denom = (model.ctxTotals[ctx] || 0) + alpha * V;
        const pFallback = denom > 0 ? alpha / denom : 1.0 / V;
        ll += Math.log(pFallback);
      }
    } else {
      // unknown context: uniform floor over alphabet
      const pGlobal = 1.0 / V;
      ll += Math.log(pGlobal);
    }
    T++;
  }

  const avgNLL = -ll / T;
  const ppx = perplexityFromAvgNLL(avgNLL);

  // Determine which threshold to use based on text length
  let activeThreshold = threshold;
  if (s.length < minLen) {
    activeThreshold = shortTextThreshold;
  }

  // Return true if text should be filtered (is nonsense)
  const isNonsense = ppx > activeThreshold;
  return isNonsense;
}

// --- Filter 2: Dominant character filter ---
function dominantCharacterFilter(text) {
 
  // Make case-insensitive and remove all whitespace and specific punctuation for analysis
  const cleanText = text.toLowerCase().replace(REGEX_CLEAN_TEXT, '');
  
  if (cleanText.length === 0) {
    return false; // Don't filter if only whitespace
  }
  
  // Count frequency of each character
  const charCounts = {};
  for (let char of cleanText) {
    charCounts[char] = (charCounts[char] || 0) + 1;
  }
  
  // Find the character that appears most frequently
  const maxCount = Math.max(...Object.values(charCounts));
  const ratio = maxCount / cleanText.length;

  // Flags the text if the most frequent character makes up more than a certain % of the total text.
  // This catches texts like "aaaaaaaaaaaa" or texts dominated by one character.
  if (ratio > 0.6) {
    return true;
  }

  return false;
}

// --- Filter 3: Character repetition filter ---
function characterRepetitionFilter(text) {
  // Make case-insensitive and remove all whitespace and specific punctuation for analysis
  const cleanText = text.toLowerCase().replace(REGEX_CLEAN_TEXT, '');

  if (cleanText.length === 0) {
    return false;
  }
  // Find all sequences of 2 or more identical characters
  const repetitions = cleanText.match(/(.)\1+/g) || [];
  
  // Calculate the total number of characters that are part of a repetition
  const repeatedCharsCount = repetitions.reduce((sum, match) => sum + match.length, 0);
  
  const ratio = repeatedCharsCount / cleanText.length;
  
  // Flag if more than a certain % of the text consists of repeated characters
  return ratio > 0.7;
}

// --- Filter 4: Long-words-compared-to-length-of-text-filter ---
function wordToCharacterRatioFilter(text) {
  // Remove all whitespace and punctuation for character length calculation
  const cleanText = text.replace(REGEX_WORD_CLEAN, '');
  
  if (cleanText.length === 0) {
    return false;
  }
  
  // Count words by splitting on whitespace and punctuation, filtering out empty strings
  const words = text.trim().split(/[\s.,!?;:"'()\[\]{}\-]+/).filter(word => word.length > 0);
  const wordCount = words.length;
  
  // Calculate ratio of words to characters (without whitespace and punctuation)
  const ratio = wordCount / cleanText.length;
  
  // Flag if the ratio is unusually low (very few words for the character count)
  // This catches texts with extremely long "words" or character sequences
  return ratio < 0.09;
}

// --- Filter 5: Dominant word filter ---
function dominantWordFilter(text) {
  // Split text into words using whitespace and punctuation
  const words = text.trim().split(/[\s.,!?;:"'()\[\]{}\-]+/).filter(word => word.length > 0);
  
  if (words.length < 3) {
    return false; // Don't filter very short texts
  }
  
  // Make case-insensitive for uniqueness check
  const lowerCaseWords = words.map(word => word.toLowerCase());
  const uniqueWords = new Set(lowerCaseWords);
  const ratio = uniqueWords.size / words.length;
  
  // Flag if unique words make up less than a certain % of total words
  // This catches texts with excessive word repetition like "the the the the the"
  if (ratio < 0.3) {
    return true;
  }
  
  return false;
}

// --- Filter 6: Word repetition filter ---
function wordRepetitionFilter(text) {
  // Split text into words using whitespace and punctuation
  const words = text.trim().split(/[\s.,!?;:"'()\[\]{}\-]+/).filter(word => word.length > 0);
  
  if (words.length < 4) {
    return false; // Don't filter very short texts
  }
  
  // Make case-insensitive for comparison
  const lowerCaseWords = words.map(word => word.toLowerCase());
  
  // Check for consecutive word repetitions
  let maxConsecutiveCount = 1;
  let currentCount = 1;
  let currentWord = lowerCaseWords[0];
  let maxRepeatedWord = currentWord;
  
  for (let i = 1; i < lowerCaseWords.length; i++) {
    if (lowerCaseWords[i] === currentWord) {
      currentCount++;
      if (currentCount > maxConsecutiveCount) {
        maxConsecutiveCount = currentCount;
        maxRepeatedWord = currentWord;
      }
    } else {
      currentWord = lowerCaseWords[i];
      currentCount = 1;
    }
  }
  
  // Flag if any word is repeated more than X times consecutively
  // AND the repeated words make up at least X% of all words
  if (maxConsecutiveCount > 5) {
    const repeatedWordCount = lowerCaseWords.filter(word => word === maxRepeatedWord).length;
    const percentageOfText = (repeatedWordCount / lowerCaseWords.length) * 100;
    
    if (percentageOfText >= 50) {
      return true;
    }
  }
  
  return false;
}

// --- Filter 7: Pure Punctuation Filter ---
function purePunctuationFilter(text) {
  // Remove all whitespace (spaces, tabs, newlines)
  const cleanedText = text.replace(REGEX_SPACES_ONLY, '');
  
  // If text becomes empty after removing whitespace, it's just whitespace
  if (cleanedText.length === 0) {
    return true;
  }
  
  // Check if text contains ANY alphabetic characters or alphanumeric characters
  // This regex matches any letter (a-z, A-Z) or number (0-9)
  const hasAlphanumeric = /[a-zA-Z0-9]/.test(cleanedText);
  
  // If no alphabetic/numeric characters found, it's pure punctuation
  if (!hasAlphanumeric) {
    return true;
  }
  
  return false;
}

module.exports = { 
  trigramFilter,
  dominantCharacterFilter,
  characterRepetitionFilter,
  wordToCharacterRatioFilter,
  dominantWordFilter,
  wordRepetitionFilter,
  purePunctuationFilter
};
